import React from 'react';
interface NavItem {
  name: string;
  href: string;
}
interface NavLinksProps {
  navItems: NavItem[];
  isMenuOpen: boolean;
}

const NavLinks: React.FC<NavLinksProps> = ({ navItems, isMenuOpen }) => {
  return (
    <ul
      className={`${
        isMenuOpen ? 'block absolute z-10 right-10 ' : 'hidden'
      } md:flex items-center justify-between font-semibold text-cyan-600 uppercase text-end`}
    >
      {navItems.map((item, index) => (
        <li key={index} className="mb-2 md:mx-10 md:mb-0">
          <a href={item.href}>{item.name}</a>
        </li>
      ))}
      {/* Mobile-only Login */}
      <li className="block md:hidden">
        <a href="#">Login</a>
      </li>
    </ul>
  );
};

export default NavLinks;
